import React, { Component } from 'react'
import  Client  from "./pages/Choix_page/Client";
import  Back_office  from "./pages/Choix_page/Back_office";
import { Route, Routes,Link } from 'react-router-dom'

function HomePage() {
    const linkColor = {
        color:'#748B6F'
      }
    return<>
         <div className='box-ensemble'>
            <Link to="/Client" style={linkColor}>
            <Client/>
            </Link>

            <Link to="/Back_office" style={linkColor}>
            <Back_office/>
            </Link>

        </div>
    </>
}



export default HomePage
